    /**
     * Returns the keywords in the given category.
     *
     * @param keywordCategory The name of the keyword category.
     * @return The keywords in the given category.
     * @throws IllegalArgumentException If the category does not exist for
     *      this scanner.
     */
    public static String[] getKeywords(String keywordCategory) {
        if (keywordCategory.equals("Keywords")) {
            return new String[] {
                "alg",
                "alphabet",
                "any",
                "attr",
                "automaton",
                "bool",
                "break",
                "case",
                "const",
                "cont",
                "continue",
                "controllable",
                "def",
                "der",
                "dict",
                "disables",
                "disc",
                "dist",
                "do",
                "edge",
                "elif",
                "else",
                "end",
                "enum",
                "equation",
                "event",
                "false",
                "file",
                "final",
                "for",
                "func",
                "goto",
                "group",
                "id",
                "if",
                "import",
                "initial",
                "input",
                "int",
                "invariant",
                "list",
                "location",
                "marked",
                "monitor",
                "namespace",
                "needs",
                "now",
                "post",
                "pre",
                "print",
                "printfile",
                "real",
                "return",
                "self",
                "set",
                "string",
                "svgcopy",
                "svgfile",
                "svgin",
                "svgmove",
                "svgout",
                "switch",
                "tau",
                "text",
                "time",
                "to",
                "true",
                "tuple",
                "type",
                "uncontrollable",
                "urgent",
                "value",
                "void",
                "when",
                "while",
            };
        }

        if (keywordCategory.equals("SupKind")) {
            return new String[] {
                "plant",
                "requirement",
                "supervisor",
            };
        }

        if (keywordCategory.equals("StdLibFunction")) {
            return new String[] {
                "acosh",
                "acos",
                "asinh",
                "asin",
                "atanh",
                "atan",
                "cosh",
                "cos",
                "sinh",
                "sin",
                "tanh",
                "tan",
                "abs",
                "cbrt",
                "ceil",
                "del",
                "empty",
                "exp",
                "floor",
                "fmt",
                "ln",
                "log",
                "max",
                "min",
                "pop",
                "pow",
                "round",
                "scale",
                "sign",
                "size",
                "sqrt",
                "bernoulli",
                "beta",
                "binomial",
                "constant",
                "erlang",
                "exponential",
                "gamma",
                "geometric",
                "lognormal",
                "normal",
                "poisson",
                "random",
                "triangle",
                "uniform",
                "weibull",
            };
        }

        if (keywordCategory.equals("Operator")) {
            return new String[] {
                "and",
                "div",
                "in",
                "mod",
                "not",
                "or",
                "sample",
                "sub",
            };
        }

        String msg = "Unknown keyword category: " + keywordCategory;
        throw new IllegalArgumentException(msg);
    }
